import React from "react";
import Sidebar from "../components/sidebar";
import { Container, Row, Col } from "react-bootstrap";
import DailyIntakeTable from "../components/dailyintaketable";
import SearchBar from "../components/searchbarearchbar";

const Dailyintakes = () => {
  // Sample data
  const dataTemplate = {
    Userid: "Data",
    Date: "Data",
    Hrsofsleep: "Data",
    Glassesofwater: "Data",
    Stepstaken: "Data",
    Caloricintake: "Data",
    Caloricdiversity: "Data",
    HALE: "Data",
    PHD: "Data",
    Mealid: "Data",
  };

  const data = Array.from({ length: 10 }, () => ({ ...dataTemplate }));



  return (
    <Container fluid>
      <Row>
        <Col md={2}>
          <Sidebar />
        </Col>
        <Col md={10}>
          <div>
            <h2 style={{marginTop:"20px",marginBottom:"20px",color:"#9FC856",fontWeight:"600"}}>Daily Intakes</h2>
            <SearchBar/>
            <DailyIntakeTable data={data} />
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Dailyintakes;
